properties.property:
local Ease = require "actions/Ease"
local Parallel = require "actions/Parallel"
local Do = require "actions/Do"
local Serial = require "actions/Serial"

return function(self)
    return Serial {
        Parallel {
            Ease(self.scene.objectLookup.WallEdge1, "y", self.scene.objectLookup.WallEdge1.y - 100, 2, "linear"),
            Ease(self.scene.objectLookup.WallEdge2, "y", self.scene.objectLookup.WallEdge2.y - 100, 2, "linear"),
            Ease(self.scene.objectLookup.WallEdge3, "y", self.scene.objectLookup.WallEdge3.y - 100, 2, "linear"),
        },
        Do(function()
            self.scene.objectLookup.WallEdge1:remove()
            self.scene.objectLookup.WallEdge2:remove()
            self.scene.objectLookup.WallEdge3:remove()
        end)
    }
end

